Adventures in Your Own Backyard was the top-selling album on the Canadian iTunes Store for the week ending on April 22. The songs of Adventures in Your Own Backyard are described as "boisterous and pretty, alive and roaming, fairytales with Watson’s skimming falsetto", and continue in the band's signature style of cinematic and orchestral pop.
